  false,\n\t\"url\": null,\n\t\"notes\": \"The Sage Steppe Ecosystem Restoration Strategy
  EIS focuses on therestoration of sage steppe ecosystems that have come to be dominated
  by juniper, as the densityof Western juniper has increased over the landscape. The
  purpose of this Restoration Strategy is to adopt an approach for juniper management
  on National Forest System and Bureau of Land Management lands encompassed by the
  6.5 million acre Analysis Area, in order to restore the sage steppe ecosystem and
  associated vegetative communities to desired habitat conditions reflecting ecological
  processes that existed pre- European settlement. This action is needed because of
  the loss of the sagebrush ecosystem across the landscape as the density of juniper
  has altered many sites from sagebrush steppe to juniper woodlands dominated. The
  cause of this ecological shift is predominately due to anthropogenic changes, and
  the associated loss of vegetative, habitat, and hydrologic values. The purpose ofnthis
  Restoration Strategy is to restore sage steppe ecosystems that have become dominated
  by Western juniper woodlands due to human causes.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
